import React, { useState, useEffect } from 'react';

function ViewMyPackages() {
  const [packages, setPackages] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    console.log("Fetching packages...");

    fetch('http://localhost:8081/package/get-package')
      .then((response) => {
        console.log("Response status:", response.status);
        if (!response.ok) {
          throw new Error('Failed to fetch packages');
        }
        return response.json();  // Asigură-te că răspunsul este JSON
      })
      .then((data) => {
        console.log("Data received:", data);
        setPackages(data);
        setLoading(false);
      })
      .catch((error) => {
        console.error("Error fetching data:", error);
        setError(error);
        setLoading(false);
      });
  }, []);

  if (loading) {
    return <p>Loading...</p>;
  }

  if (error) {
    return <p>Error loading packages: {error.message}</p>;
  }

  if (packages.length === 0) {
    return <p>No packages available.</p>;
  }

  return (
    <div>
      <h2>My Packages</h2>
      <ul>
        {packages.map((pkg) => (
          <li key={pkg.id}>
            <strong>Package ID:</strong> {pkg.id}<br />
            <strong>Courier Name:</strong> {pkg.courier ? pkg.courier.name : 'N/A'}<br />
            <strong>Created On:</strong> {pkg.createdOn}<br />
            <strong>Delivery Address:</strong> {pkg.deliveryAddress}<br />
            <strong>Status:</strong> {pkg.status}<br />
          </li>
        ))}
      </ul>
    </div>
  );
}

export default ViewMyPackages;
